import React from "react";

const WorkCard = ({ data }) => {
  return (
    <div className="bg-white rounded-2xl shadow p-4">
      <h2 className="text-xl font-semibold mb-2">Work</h2>
      {data ? (
        <>
          <p className="text-gray-600">Projects: {data.projects}</p>
          <p className="text-gray-600">Pending Tasks: {data.pendingTasks}</p>
          <p className="text-gray-600">Reports: {data.reports}</p>
        </>
      ) : (
        <p className="text-gray-400">Loading...</p>
      )}
    </div>
  );
};

export default WorkCard;
